"""
created by huash at 2015-05-01 16:43

Given a string S and a string T, count the number of distinct subsequences of T in S.

A subsequence of a string is a new string which is formed from the original string by
deleting some (can be none) of the characters without disturbing the relative positions
of the remaining characters. (ie, "ACE" is a subsequence of "ABCDE" while "AEC" is not).

Here is an example:
S = "rabbbit", T = "rabbit"

Return 3.
"""
__author__ = 'huash'

import sys
import os
import functools
import collections
class Solution:
    # @param {string} s
    # @param {string} t
    # @return {integer}
    def numDistinct(self, s, t):
        if not s or not t:
            return 0

        return self.dfs(s, t, len(s), len(t))

    @functools.lru_cache(maxsize=None)
    def dfs(self, s, t, si, ti):
        """
        设f(i, j)表示s的前i个字符和t的前j个字符的匹配数量。

        考虑s的第si个字符s[si-1]，和t的第ti个字符t[ti-1]。
        1. 如果s[si-1] == t[ti-1]，
            那么s的第si个字符可以匹配t的第ti个字符，也可以不匹配。
            即f(i, j) = f(i-1, j-1) + f(i-1, j)
        2. 否则
            f(i, j) = f(i-1, j)

        终止条件:
        1. f(0, j) = 0
        2. f(i, 0) = 1

        :param s:
        :param t:
        :param si:
        :param ti:
        :return:
        """
        if si == 0:
            return 0
        if ti == 0:
            return 1

        if si < ti:
            return 0
        elif si == ti:
            if s[:si] == t[:ti]:
                return 1
            else:
                return 0
        if s[si-1] == t[ti-1]:
            return self.dfs(s, t, si-1, ti-1)+self.dfs(s, t, si-1, ti)
        else:
            return self.dfs(s, t, si-1, ti)

    def dp(self, s, t):
        """
        直接把上面的dfs转换为DP
        :param s:
        :param t:
        :return:
        """
        if not s or not t:
            return 0
        g = [[0 for c in range(len(t)+1)] for r in range(len(s)+1)]

        for i in range(len(t)+1):
            if s[:i] == t[:i]:
                g[i][i] = 1
            else:
                break
        for i in range(1, len(s)+1):
            g[i][0] = 1

        for j in range(1, len(t)+1):
            for i in range(1, len(s)+1):
                if s[i-1] == t[j-1]:
                    g[i][j] = g[i-1][j-1] + g[i-1][j]
                else:
                    g[i][j] = g[i-1][j]
        return g[len(s)][len(t)]


    def dp2(self, s, t):
        if not s or not t:
            return 0

        ci = collections.defaultdict(list)
        for i, v in enumerate(s):
            ci[v].append(i)


        n = len(t)
        m = len(s)
        dp = [[0 for _ in range(m+1)] for _ in range(n+1)]

        for i in ci[t[0]]:
            dp[0][i] = 1

        for i in range(1, n):
            idx = ci[t[i]]
            for j in idx:
                # map t[i] to s[j]

                idx2 = ci[t[i-1]]
                for k in idx2:
                    if k < j:
                        # map t[i-1] to s[k], k < j
                        dp[i][j] += dp[i-1][k]

        return sum(dp[n-1])
sys.setrecursionlimit(200000)
s = Solution()
print(s.numDistinct('', 'a'))
print(s.numDistinct('rabbbit', 'rabbit'))
print(s.numDistinct('ccc', 'c'))
print(s.numDistinct("aabdbaabeeadcbbdedacbbeecbabebaeeecaeabaedadcbdbcdaabebdadbbaeabdadeaabbabbecebbebcaddaacccebeaeedababedeacdeaaaeeaecbe", "bddabdcae"))
print(s.numDistinct("", "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"))

print(s.dp('', 'a'))
print(s.dp('rabbbit', 'rabbit'))
print(s.dp('ccc', 'c'))
print(s.dp("aabdbaabeeadcbbdedacbbeecbabebaeeecaeabaedadcbdbcdaabebdadbbaeabdadeaabbabbecebbebcaddaacccebeaeedababedeacdeaaaeeaecbe", "bddabdcae"))
print(s.numDistinct("", "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"))